import logo from './feliciano.png';
import './App.css';

function App() {
  return (
   <div>
    <div className="header">
       <h1>Logo</h1>
       <nav>
          <ul>
            <li>Home</li>
            <li>About</li>
            <li>Project</li>
            <li>Contact</li>
          </ul>
       </nav>      
    </div>
    <div className="content">
          <h1>Mark Feliciano</h1>
          <p>Front-end Developer</p>
       </div>
    </div>
  );
}

export default App;
